import React from "react";
import { Link } from "react-router-dom";
import Signup from "../signup/Signup";
const Login = () => {
  return (
    <div className="flex flex-col justify-center gap-10 items-center w-screen h-screen">
      <h1 className=" text-xl font-bold tracking-widest  text-sky-700">
        Login User
      </h1>
      <label className="form-control w-full max-w-xs ">
        <input
          type="text"
          placeholder="Username"
          className="input input-bordered input-primary w-full max-w-xs focus:outline "
        />
      </label>
      <label className="form-control w-full max-w-xs">
        <input
          type="text"
          placeholder="Password"
          className="input input-bordered input-primary  w-full max-w-xs "
        />
      </label>
      <div className="flex justify-start border ">
        <Link to="/signup">Don't have account ?</Link>
      </div>
      <button className="btn btn-active btn-primary  w-full max-w-xs">
        Login
      </button>
    </div>
  );
};

export default Login;
